import React, { Component } from "react";

const demots = [
  {
    id: 1,
    title: "Go to Market",
  },
  {
    id: 2,
    title: "Study",
  },

];

function renderItems(){
  return demots.map((demot) => {
    <p>{demot.title}</p>
  })
}

function App() {
  return
    <div>
    demots.map((demot) => {
      <p>{demot.title}</p>
    })
    </div>
}

export default App;
